import React from 'react'

const ReviewCard = () => {
  return (

     <Container>
       <Row>
       <h2>Reviews</h2>
       <p>See Star ratings and reviews left by clients after their visit.Learn More</p>
       
       </Row>
     
     </Container>
  )
}

export default ReviewCard
